import React from 'react';
import {
  Container, 
  ImageProduct, 
  PaymentBox,
  InfosProduct,
  InfoLeft
} from './styles';

function CheckoutDesktop(props) {
  const { product } = props
  return (
    <Container>
      <ImageProduct>
        <img src={product.MaxresURL} alt="Product" />
      </ImageProduct>
      <PaymentBox>
        <InfosProduct>
          <InfoLeft>
            <Description>
              <p>{props.location.state.description}</p>
              <p>
                x 1, {props.location.state.color}, Size {props.location.state.size}
              </p>
              <p>Item #{props.location.state.id}</p>
            </Description>
          </InfoLeft>
        </InfosProduct>
      </PaymentBox>
    </Container>
  );
};

export default CheckoutDesktop;
